import React, { useState, useEffect } from 'react'
import { Card, CardMedia, CardContent, CardActions, IconButton, Paper } from '@material-ui/core';
import { TextField, Typography, Grid, Button } from '@material-ui/core'
import { api } from '../../COMPONENTS/axiosSetup';
import Navbar from '../../COMPONENTS/Navbar/Navbar';
function AdminPage() {
    const [magac, setMagac] = useState('')
    const [telephone, setTelephone] = useState('')
    const [ciwaan, setCiwaan] = useState('')
    const [email, setEmail] = useState('')
    const [password, setPassword] = useState('')
    async function keydiAdmin(){
        if((magac !='' && telephone !='') && (ciwaan !='' && email !='') && password !=''){
           const data =  await (await api.post('/dir/admin/users', {magac, telephone, ciwaan, email, password, role:'admin'})).data
           alert(data.status)
        }
    }
    
  return (
    <>
    <Navbar />
    <Grid conainer>
        <Grid item xs={12} sm={6}>
    <Grid container style={{padding:'30px'}}>
        <Grid item xs={12} sm={12} style={{marginBottom:'30px'}}>
            <Typography variant='h4' align='center' gutterBottom>DIIWAANGELI ADMIN</Typography><hr style={{width:'300px'}} />
        </Grid>
      <Grid item xs={12} sm={6} style={{margin:'10px 0px'}} >
        <TextField onChange={(e)=> setMagac(e.target.value)} placeholder='magaca oo saddexan'/>

      </Grid>
      <Grid item xs={12} sm={6} style={{margin:'10px 0px'}} >
        <TextField onChange={(e)=> setCiwaan(e.target.value)} placeholder='ciwaanka'/>

      </Grid>
      <Grid item xs={12} sm={6} style={{margin:'10px 0px'}}>
        <TextField onChange={(e)=> setTelephone(e.target.value)} placeholder='telephone'/>

      </Grid>
      <Grid item xs={12} sm={6} style={{margin:'10px 0px'}} >
        <TextField onChange={(e)=> setEmail(e.target.value)} placeholder='email'/>

      </Grid>
      <Grid item xs={12} sm={6} style={{margin:'10px 0px'}}>
        <TextField onChange={(e)=> setPassword(e.target.value)} placeholder='password'/>
      </Grid>
      <Grid item xs={12} sm={12} style={{marginTop:'30px'}}>
        <Button variant='contained' color='primary'>DIIWAANGELI</Button>
      </Grid>
    </Grid>
        </Grid>
    </Grid>
    </>
  )
}

export default AdminPage
